#ilmiolentoavvento - 9 dicembre

Un strada secondaria di campagna, in mezzo ai colori che cambiano col variare di stagione;
Una paio di pantaloni comodi, una felpa con cappuccio, le cuffiette per ascoltare musica da un orecchio;
Un passo che segue l'altro non verso una meta, ma verso una sensazione, di benessere;
I cani nei cortili delle poche case disseminate sul percorso che mi salutano abbaiando, i gatti che si fanno fotografare spaparanzati a pancia in su ma sia mai che mi salutano, la vibrazione dell'erba tra i cespugli al passaggio di qualche animaletto, lo scoiattolino che corre impazzito tra un albero e l'altro.

Facciamo che rallentiamo, Marì, che non ho mica fretta di arrivare al traguardo!

#facciamocherallentiamo #gioiedinatale #day9
